import React from "react";
import ArticleList from "./ArticleList";

const Newest = () => {
  return (
    <div>
      <header>
        <div style={{ padding: "12px" }}>
          <h1>Newest</h1>
        </div>
        <p>The most up to the minute articles on NC-News.</p>
      </header>
      <ArticleList urlPath="?sort_by=created_at" />
    </div>
  );
};

export default Newest;
